export const getQuestionList = (difficultyLevel) => {
  return async () => {
    const endpoint = `https://opentdb.com/api.php?amount=10&difficulty=${difficultyLevel.level}`;
    const data = await (await fetch(endpoint)).json();

    return {
      type: "GET_QUESTIONS_LIST",
      payload: data,
    };
  };
};
